import React from "react";
import { Link } from "react-router-dom";

export default function LandingPage() {
  return (
    <div>
      <div>
        <h4>HOLA!!!</h4>
        <Link to="/home">
          <button>ENTER</button>
        </Link>
      </div>
    </div>
  );
}
